document.addEventListener('DOMContentLoaded', function() {
    setupNavigation();
    fetchTickets();
});

function setupNavigation() {
    document.querySelectorAll('nav ul li button').forEach(btn => {
        btn.addEventListener('click', function() {
            document.querySelectorAll('nav ul li button').forEach(button => {
                button.classList.remove('active');
            });
            this.classList.add('active');
            let sectionId = this.getAttribute('onclick').split("'")[1];
            showSection(sectionId);
        });
    });
}

function showSection(sectionId) {
    document.querySelectorAll('.section').forEach(section => {
        section.classList.add('hidden');
    });
    document.getElementById(sectionId).classList.remove('hidden');
}

// Assuming supabase was set up correctly and imported
function fetchTickets() {
    supabase
        .from('Ticket')
        .select(`
            Ticket_ID,
            User_ID,
            TicketStatus: TicketStatus(StatusName),
            SeatID,
            Flight_ID,
            person: User_ID (fname, mname, lname),
            flight: Flight_ID (TakeoffCity, ArrivalCity, TakeoffTime, ArrivalTime)
        `)
        .then(({ data, error }) => {
            if (error) {
                console.error('Error fetching tickets:', error);
                return;
            }
            const ticketList = document.getElementById('ticket-list');
            ticketList.innerHTML = data.map(ticket => `
                <tr>
                    <td>${ticket.Ticket_ID}</td>
                    <td>${ticket.person.fname} ${ticket.person.mname} ${ticket.person.lname}</td>
                    <td>${ticket.TicketStatus.StatusName}</td>
                    <td>${ticket.SeatID}</td>
                    <td>${ticket.flight.TakeoffCity} to ${ticket.flight.ArrivalCity}, ${ticket.flight.TakeoffTime} to ${ticket.flight.ArrivalTime}</td>
                    <td>
                        <button onclick="editTicket(${ticket.Ticket_ID})">Edit</button>
                    </td>
                </tr>
            `).join('');
        });
}

function showForm() {
    document.getElementById('ticket-form').style.display = 'block';
}

function hideForm() {
    document.getElementById('ticket-form').style.display = 'none';
}

function submitForm() {
    const formData = new FormData(document.getElementById('form'));
    const ticketData = {
        User_ID: formData.get('userId'),
        TicketStatus: parseInt(formData.get('ticketStatus')),
        SeatID: formData.get('seatId'),
        Flight_ID: parseInt(formData.get('flightId'))
    };

    // Decide whether to update or insert based on the presence of an ID in the form
    const method = formData.get('ticketId') ? 'update' : 'insert';
    const query = method === 'insert' ?
        supabase.from('Ticket').insert([ticketData]) :
        supabase.from('Ticket').update(ticketData).match({ Ticket_ID: formData.get('ticketId') });

    query.then(({ data, error }) => {
        if (error) {
            console.error('Error submitting ticket:', error);
            return;
        }
        fetchTickets();  // Refresh the list
        hideForm();  // Hide the form
    });
}

function editTicket(ticketId) {
    supabase
        .from('Ticket')
        .select('*')
        .eq('Ticket_ID', ticketId)
        .single()
        .then(({ data, error }) => {
            if (error) {
                console.error('Error fetching ticket details:', error);
                return;
            }
            document.getElementById('userId').value = data.User_ID;
            document.getElementById('ticketStatus').value = data.TicketStatus;
            document.getElementById('seatId').value = data.SeatID;
            document.getElementById('flightId').value = data.Flight_ID;
            document.getElementById('ticketId').value = data.Ticket_ID; // Assuming you have a hidden input for ticketId in your form
            showForm();
        });
}

function logout() {
    console.log('Logging out...');
    window.location.href = 'mainpage.html';
}
